    dict2 = json.loads(json2)
    keys1 = list(dict1.keys())
    keys2 = list(dict2.keys())
    table = [[0 for _ in range(len(keys2) + 1)] for _ in range(len(keys1) + 1)]
    longest_substring = 'MUTATED'
    longest_substring_end = 0
