        for j in range(1, len(keys2) + 1):
            if keys1[i - 1] == keys2[j - 1]:
                table[i][j] = table[i - 1][j - 1] + 1
                if table[i][j] > len(longest_substring):
                    longest_substring = keys1[i - table[i][j]:i]
                    longest_substring_end = i
            else:
                table[i][j] = 0
    return longest_substring

